INSERT INTO `content` (`id`, `alias`, `description`, `content`, `is_blocked`, `available`, `name`) VALUES
(1, 'greece', '<p><br>\r\nНа данной странице предлагаются все чартерные и регулярные рейсы. Для получения информации о датах на чартерные рейсы перейдите на соответствующую страницу \r\n(<a href="athens.php">Афины</a>, <a href="thessaloniki.php">Салоники</a>, <a href="krit.php">Крит</a>, <a href="kos.php">Кос</a> или <a href="rodos.php">Родос</a>) либо позвоните в контакт центр. \r\n<br><b>Все регулярные рейсы доступны онлайн</b> - выберите в форме города и даты. </p>', '<h3 class="top" style="text-align:left;">Портал чартерных авиаперевозок<span>Авиакомпании, туроператоры и агентства</span></h3>	\n\n<h1 class="txt">Авиабилеты в Грецию из Украины</h1>\n<p>Греция является идеальной страной для путешествий. В ней много пляжей, гор, \nскалистых островов, лесов, а также исторических мест, культовых сооружений, \nименно в Греции зарождалась цивилизация.</p>\n<p>На сайте мы предоставляем возможность клиентам не только <b>купить авиабилеты \nв Грецию</b>, но также ознакомиться с подробным расписанием авиарейсов, узнать о \nналичии свободных мест, условиям авиатирифов, дополнительную информацию, и при \nэтом, данные услуги предоставляются совершенно бесплатно.</p>\n<p><a href="http://echarter.com.ua/athens.php">Авиабилеты Киев - Афины</a> (Чартеры в Грецию - 150 USD, из Киева, Львова и Одессы). \n<a href="http://echarter.com.ua/thessaloniki.php">Авиабилеты: Киев - Салоники</a><br></p>\n\n<br>\n\n<h2>Авиабилеты в Грецию – специальное предложение</h2>\n<p>Самолетом попасть из Украины в Грецию возможно из трех городов: <b>Киева, \nЛьвова и Одессы</b>. Авиа-перелеты осуществляет компания "Хорс", предлагая \nрекордно низкие <b>цены на авиабилеты</b>.</p>\n<p>На нашем сайте вы можете <b>забронировать билет на самолет в Грецию</b>, а \nпосле его выкупить, оплатив наличными или с помощью кредитной карты. </p>\n<p>Также у нас вы можете заказать трансфер в аэропорт из любого города Украины. \nГибкая система скидок позволит вам сэкономить средства и сделает поездку более \nприятной.</p>\n\n<h2>Забронировать авиабилеты в Грецию</h2>\n<p>У нас на сайте мы предоставляем возможность клиентам не только <b>купить \nавиабилеты в Грецию</b>, но также ознакомиться с подробным расписанием \nавиарейсов, узнать о наличие свободных мест. Данная услуга предоставляется \nбесплатно.</p>\n<p><b>Заказать авиабилеты в Грецию</b> можно по телефону. Для этого пассажирам \nжелательно заранее подобрать наиболее удобный рейс, определиться с временем и \nдатой вылета в Грецию. Также следует указать при заказе билета класс \nобслуживания и авиатариф.</p>\n<p>Мы предоставляем пассажирам всю справочную информацию об условиях \nавиаперелета лайнерами компании "Хорс" и условия возврата денег в случае \nпереноса времени или даты вылета.</p>\n\n<h2>Купить авиабилеты в Грецию</h2>\n<p>Для покупки или бронирования авиабилетов на рейсы в Грецию, в форму поиска \nнеобходимо ввести страну, город и планируемую дату вылета, далее нажмите кнопку \n"Поиск".</p>\n<p>Наша поисковая система за несколько секунд подберет вам все возможные \nварианты авиарейсов в Грецию из Украины, от наиболее экономных до более \nдорогостоящих.</p>\n<p>Также мы предоставляем пассажирам возможность купить билеты в оба конца, или \nже подберем рейс из Греции в другую страну. При этом вы имеете возможность \nузнать более подробную информацию не только о стране и городе прибытия, но и о \nаэропортах и трансферах из них в другие города.</p>\n<p>Когда вы подберете удобный для себя авиарейс в Грецию, класс и место полета, \nзабронируйте билет и выберите способ оплаты. Данная услуга предоставляется \nбесплатно. </p>\n<p>Обязательно ознакомьтесь на нашем сайте с условиями осуществления сделки, \nвнимательно прочитайте условия выкупа авиабилета в Грецию, правила его возврата \nили обмена, ознакомьтесь с условиями выбранного тарифа.</p>\n<p>Если вы забронировали авиабилет, то имеете право отказаться от него или \nизменить дату и время вылета. Данная услуга бесплатна и не подразумевает оплату \nштрафов или неустоек.</p>\n<p>В стоимость авиаперелета в Грецию включены все обязательные платежи, включая \nсервисный сбор в аэропорту и комиссионную выписку билета.</p>\n<p><b>Цена авиабилета</b> составляет лишь <b>100 Евро по авиатарифу</b> с \nначислением аэропортового и топливного сбора, но вы можете самостоятельно \nубедится что это действительно <b>дешево</b>, при чем намного <b>дешевле</b> чем \nна самолеты с пересадкой и почти также как и на <b>чартер</b>.</p>\n<p>После того, как вы забронируете и подтвердите заказ авиабилета в Грецию, на \nваш электронный ящик придет письмо о подтверждении брони.</p>\n<p>При возникновении каких-либо вопросов по бронированию и выкупу авиабилета в \nГрецию звоните в нашу службу поддержки, где вам предоставят бесплатно \nисчерпывающую информацию о других способах оплаты билетов либо подскажут адрес \nофиса в котором можно купить авиабилет без досрочного заказа по Интернет.</p>\n\n<h3>Оплата авиабилетов по Интернет</h3>\n<p>На сайте есть услуга "электронный билет", с помощью которой вы имеете \nвозможность оплатить <b>авиабилет в Грецию</b> через эквайринг, имея банковскую \nкарту.</p>\n<p>При покупке билетов через интернет вы получите билет на свой почтовый ящик, \nпосле чего с вами по телефону свяжется служба поддержки авиакомпании "Хорс". Или \nже вы получите смс-сообщение, содержащее всю информацию о рейсе. </p>\n<p>Полученный по электронной почте билет необходимо распечатать и предъявить при \nрегистрации на рейс в аэропорту. Если вы не распечатали билет – достаточно будет \nпоказать сотруднику аэропорта при посадке на рейс текст смс-сообщения в \nмобильном телефоне для авторизации вас как пассажира.</p>\n\n<h3>Самые популярные авиарейсы самолетов в Грецию</h3>\n<p>Наибольшей популярностью пользуются <b>авиабилеты в Грецию на чартерные рейсы</b>. \nБилет на самолет, совершающий регулярные вылеты, стоит дороже, но таким образом \nВы сможете планировать поездку. На нашем сайте вы можете узнать о наличие \nсвободных мест на нужный вам рейс и подобрать для себе самый приемлемый вариант.</p>\n<p>С 31 марта 2013 года авиакомпания "Хорс" возобновила <b>регулярные авиарейсы \nв Грецию из Украины</b>. Воспользоваться этим уникальным предложением и <b>\nкупить авиабилеты Киев-<a href="http://echarter.com.ua/athens.php">Афины</a>, Львов-Афины или Одесса-Афины</b> можно на нашем \nсайте онлайн.</p>\n\n<h4>Спецпредложения на самолеты в Грецию:</h4>\n\n<p><b>Авиабилеты в Афины из \nКиева</b></p>\n<p><b>Авиабилеты в Афины из Львова</b></p>\n<p><b>Авиабилеты в Афины из Одессы</b></p>\n<p><b>Авиабилеты в Салоники из Киева</b></p>\n\n<p>При бронировании и покупке авиабилетов в Грецию с помощью нашего сайта вы \nполучаете авиабилет, отвечающий всем требованиям Международной ассоциации \nвоздушного транспорта (IATA). При обмене или возврате электронного билета вам \nнеобходимо обратиться в агентство, контактные данные которого указаны в \nписьме-подтверждении при бронировании.</p>\n\n<h3>Аэропорты Греции</h3>\n<p>В Греции насчитывается более 50 аэропортов. Большинство из них расположены на \nостровах. Из Украины в Грецию можно попасть в Афины, Салоники, Ираклион и Родос.<br>\nАэропорт Афин (Eleftherios Venizelos) – является главным аэропортом страны. Он \nпринимает как внутренние, так и международные рейсы. В Афины прилетают также \nпассажиры, следующие в Аттику. В год через терминалы аэропорта проходит более 16 \nмиллионов пассажиров. Это крупнейший на Ближнем Востоке аэропорт (так как \nнаходится в непосредственной близости от региона). Международный аэропорт Афин \nрасположен в 20 км от города, со столицей Греции аэропорт связывают железная \nдорога, метро и автобан. <br>\nБлагодаря стараниям руководства Афинского аэропорта совместно с греческими \nвластями, а также иностранным инвестициям, автотранспортное и железнодорожное \nсообщение с Афинами или любым другим пунктом в Аттике позволяет не волноваться \nпассажирам о трансфере.</p>\n<p>Международный аэропорт Салоники SKG (Македония) находится в 15 км от города \nСалоники, из него осуществляются рейсы на Кипр и в Европу.<br>\nВторой по величине аэропорт Греции - в Ираклионе - HER (Никос Казандзакис), \nкоторый удален от этого города на 4 км.</p>\n\n<h4>Интересные факты о Греции</h4>\n<p>Расположена Греция в юго-восточной Европе, имеет границы с Болгарией, \nАлбанией, Турцией и Македонией. Площадь Греции 131 940 кв.км, столица – Афины. \nВремя в Греции не отличается от киевского, так что при переезде в страну вы не \nбудете чувствовать никакого дискомфорта.</p>\n<p>В Греции хорошо развита сеть транспортного сообщения: троллейбусы, автобусы \n(в том числе и междугородные), железная дорога и морское сообщение. Для дальних \nпоездок наиболее подойдет авиасообщение, в стране много компаний, выполняющих \nвнутренние авиарейсы. В столице Греции помимо автобусных и троллейбусных \nмаршрутов есть два метро – наземное и подземное.</p>\n<p>Такси в Греции сравнительно недорогое, проезд оплачивается по счетчику, но в \nночное время действует двойной тариф.</p>\n<p>Греция богата на достопримечательности. Среди их множества стоит выделить \nДельфы, Олимп, Микены, остров Крит и Олимпию.</p>\n<p>Из Украины в Грецию можно попасть всеми видами транспорта, но наиболее удобно \n– самолетом.</p>', 0, 0, ''),
(2, 'qweqw', 'eeww', 'qwewwqweqwewqe', 0, 0, 'qweqwe');
